def solve():
    n, q = map(int, input().split())
    painters = [list(map(int, input().split())) for _ in range(q)]  
    sections_counts = [0 for _ in range(n)]

    for l, r in painters:
        sections_counts[l-1] += 1
        if r < n:
            sections_counts[r] -= 1

    sections_painted = [0 for _ in range(n)]

    for i in range(1, n):
        sections_counts[i] += sections_counts[i - 1]

    for i in range(n):
        if sections_counts[i] > 0:
            sections_painted[i] = 1

    max_painted = max(sections_painted)
    return max_painted

