        if main_course in dependencies:
            for prereq_course in dependencies[main_course]:
                if prereq_course not in completed_courses:
                    queue.append(prereq_course)           

        while queue:
            current_course = queue.popleft()
            if current_course in completed_courses:
                continue
            if main_course in graph[current_course] or current_course == main_course:
                required_courses.add(current_course)
