from collections import deque

def solve():
    n, k = map(int, input().split())
    p_known = list(map(int, input().split()))
    used = set(p_known)
    extra = deque()
    next_num = n

    for num in range(1, n + 1):
        if num not in used:
            if num != next_num:
                extra.appendleft(num)
            else:
                position_to_put = sum(d < num for d in extra)
                if position_to_put >= len(extra):
                    extra.appendleft(next_num)
                    next_num -= 1
                else:
                    extra.rotate(position_to_put)
                    extra.appendleft(next_num)
                    next_num -= 1

    perm = p_known + list(extra)

    if sorted(perm[:k]) == p_known:
        print(" ".join(map(str, perm)))
    else:
        print(-1)

