def solve():
    import datetime

    time_str = input()

    def is_palindrome(time_str):
        return time_str == time_str[::-1]

    def minutes_until_next_palindrome(time_str):
        current_time = datetime.datetime.strptime(time_str, '%H:%M')
        while not is_palindrome(current_time.strftime('%H:%M')):
            current_time += datetime.timedelta(minutes=1)
        next_palindrome_time = current_time.strftime('%H:%M')
        delta = datetime.datetime.strptime(next_palindrome_time, '%H:%M') - datetime.datetime.strptime(time_str, '%H:%M')
        return delta.total_seconds() // 60

    min_sleep_minutes = minutes_until_next_palindrome(time_str)
    return int(min_sleep_minutes)

