def solve(n, k):
    if k > n**2 or k < n:
        return -1

    matrix = [[0]*n for _ in range(n)]
    for i in range(n):
        if k >= 2 and i < n:
            matrix[i][i] = 1
            matrix[i][n-i-1] = 1
            k -= 2
        elif k == 1:
            matrix[n//2][n//2] = 1
            k -= 1
            break

    return '\n'.join([' '.join(map(str, row)) for row in matrix])

