import math

def solve():
    def get_nth_layer(move):
        layer = 0
        num_moves_in_layer = 0

        while num_moves_in_layer < move:
            layer += 1
            num_moves_in_layer += 6 * layer

        return layer

    def get_position_in_layer(move, layer):
        start = (layer - 1) * layer * 6
        quadrant = math.trunc((move - start) / layer)
        index_in_quadrant = (move - start) % layer

        if quadrant == 0:
            return [layer, -index_in_quadrant]
        elif quadrant == 1:
            return [-index_in_quadrant, layer]
        elif quadrant == 2:
            return [-layer, layer - index_in_quadrant]
        elif quadrant == 3:
            return [-layer + index_in_quadrant, -layer]
        elif quadrant == 4:
            return [index_in_quadrant, -layer]
        elif quadrant == 5:
            return [layer, -layer + index_in_quadrant]

    moves = int(input())

    if moves == 0:
        return "0 0"

    layer_num = get_nth_layer(moves)
    position = get_position_in_layer(moves, layer_num)

    return f"{position[0]} {position[1]}"

solve()

