import math

def get_hexagon_coordinates(n):
    k = math.ceil((math.sqrt(n + 1) - 1) / 2)
    t = 2 * k
    top_right = t * (t + 1) - n

    if n >= 4 * k * (k-1):
        return (-k + top_right, 1 - k)
    elif n >= 2 * k * (k - 1):
        return (-t, top_right - k)
    elif n >= 1 + 4 * k * (k + 1):
        return (-t + top_right, k)
    elif n >= 4 * k * (k + 1):
        return (k, t - top_right + k)
    else:
        return (k - top_right, t)

