from typing import List

def solve(n: int, k: int) -> List[int]:
    if n == 1:
        if k == 1:
            return [0]
        else:
            return [-1] * k
    result = [1] * k
    result[0] = self._log2(n)
    available = n - (1 << result[0])
    for i in reversed(range(1, k)):
        bits = min(self._log2(available // i), 60 - result[i], 60 - result[0]) + 1
        result[i] = bits
        available -= (1 << bits) * i
    return result

def _log2(x):
    return x.bit_length() - 1

solve()

