from typing import List

def solve(n: int, k: int) -> str:
    res = []
    while n > 0 and k > 0:
        curr_power = 2**(n.bit_length()-1)
        if curr_power <= n - (2**(k-1) - 1):
            res.append(str(n.bit_length()-1))
            n -= curr_power
        else:
            res.append(str(k-1))
            n -= 2**(k-1)
        k -= 1
    res += ['0'] * k
    if n == 0 and k == 0:
        return "Yes" + "\n" + " ".join(res)
    else:
        return "No"



