def solve():
    n, t = map(int, input().split())
    glasses = min(n * (n + 1) // 2, 2 ** n)

    for i in range(min(t, n)):
        last_glasses = [0] * (n + 1)
        if i == 0:
            last_glasses[-1] = 1
        for glass in range(n, 0, -1):
            overflow = 0
            for j in range(n):
                if last_glasses[j] > 1:
                    overflow = (last_glasses[j] - 1) / 2
                    last_glasses[j] = 1
            last_glasses = [max(0, x) + overflow for x in last_glasses]

        if n > 1:
            overflowed = [i for i in range(n+1) if last_glasses[i] > 1]
            for glass in overflowed:
                last_glasses[glass-1] += (last_glasses[glass] - 1) / 2
                last_glasses[glass+1] += (last_glasses[glass] - 1) / 2
                last_glasses[glass] = 1

        full_glasses = len([x for x in last_glasses if x == 1])

    print(min(full_glasses, glasses))

