import itertools

def solve():
    n = int(input())

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    def generate_primes_sum(n, r):
        for combo in itertools.combinations_with_replacement([i for i in range(2, n)], r):
            if sum(combo) == n and all(is_prime(x) for x in combo):
                return combo

    for k in range(2, 0, -1):
        primes = generate_primes_sum(n, k)
        if primes:
            break

    print(len(primes))
    print(' '.join(map(str, primes)))

