        if curr_time == T:
            return 1

        total_ways = 0
        for idx in range(n):
            if not (curr_mask >> idx) & 1:
                t_i, g_i = songs[idx]
                if t_i + curr_time <= T and g_i != prev_genre:
                    total_ways += backtrack(curr_time + t_i, curr_mask | (1 << idx), g_i)

        return total_ways % (10**9 + 7)

    n, T = map(int, input().split())
    songs = [tuple(map(int, input().split())) for _ in range(n)]

    return backtrack(0, 0, 0)

