import math

def solve():
    MOD = 10**9 + 7
    m = int(input())

    def gcd(a, b):
        while b != 0:
            a, b = b, a % b
        return a

    def power(x, y):
        res = 1
        while y > 0:
            if y % 2 == 1:
                res = (res * x) % MOD
            y //= 2
            x = (x * x) % MOD
        return res

    def mod_inverse(a):
        return power(a, MOD - 2)

    total = 0

    for i in range(1, m + 1):
        matrix = pow(m, mod_inverse(i), MOD) - pow(m - 1, mod_inverse(i), MOD)
        total += i * matrix

    expected_length = pow(mod_inverse(m), 2, MOD) * total % MOD
    print(expected_length)

