def find_maximum_value_contained(n, k):
    dp = [-1] * n

    for i in range(n):
        if i == 0:
            dp[i] = 1
        elif i % 2 == 0:
            dp[i] = dp[i // 2] * 2
        else:
            dp[i] = dp[i - 1]

    all_values_map = {}

    for i in range(n):
        current = i
        while True:
            if dp[current] not in all_values_map:
                all_values_map[dp[current]] = set()
            all_values_map[dp[current]].add(i)
            if dp[current] == 1:
                break

            current = dp[current]

    goal_values = [key for key, value in all_values_map.items() if len(value) >= k]

    return max(goal_values)

