    import itertools

    N = int(input())
    board = [list(map(int, input().split())) for _ in range(N)]

    positions = {board[i][j]: (i, j) for i in range(N) for j in range(N)}

    def manhattan_distance(p1, p2):
        return abs(p1[0] - p2[0]) + abs(p1[1] - p2[1])

    def get_moves(piece, current_pos, target_pos):
        if piece == 'knight':
            return 1 if manhattan_distance(current_pos, target_pos) == 3 else 2
        elif piece == 'bishop':
            return 1 if abs(current_pos[0] - target_pos[0]) == abs(current_pos[1] - target_pos[1]) else 2
        elif piece == 'rook':
            return 1 if current_pos[0] == target_pos[0] or current_pos[1] == target_pos[1] else 2

    min_steps = float('inf')
    min_replacements = float('inf')

    for perm in itertools.permutations(['knight', 'bishop', 'rook']):
        steps = 0
        replacements = 0
        current_pos = positions[1]

        for num in range(2, N**2 + 1):
            target_pos = positions[num]
            piece = perm[0]

            steps += get_moves(piece, current_pos, target_pos)
            if piece != 'knight':
                replacements += 1

            current_pos = target_pos

        if steps < min_steps or (steps == min_steps and replacements < min_replacements):
            min_steps = steps
            min_replacements = replacements

    print(min_steps, min_replacements)

