import numpy as np

def solve(n, m, A):
    # Convert input array into numpy matrix
    A = np.array(A)

    # Create an empty matrix B of size NxM filled with zeros
    B = np.zeros((n, m), dtype=int)

    operations = []

    for i in range(1, n):
        for j in range(1, m):
            if A[i, j] != B[i-1, j-1]:
                # Perform the operation by setting the submatrix to 1
                B[i-1:i+1, j-1:j+1] += 1

                # Store the operation consisting of coordinates x and y
                operations.append((i, j))

    if np.array_equal(A, B):
        # Output the number of operations and coordinates
        print(len(operations))
        for op in operations:
            print(op[0], op[1])
    else:
        print(-1)

