from sympy import Segment, Point, GeometryError

def solve():
    N, M = map(int, input().split())
    cow_point = Point(0, 0)
    field_areas = []

    for _ in range(N):
        A, B, C = map(int, input().split())
        ns_segment = Segment(Point(A, C), Point(B, C))
        field_areas.append(ns_segment.projection(cow_point))

    for _ in range(M):
        D, E, F = map(int, input().split())
        ew_segment = Segment(Point(D, E), Point(D, F))
        try:
            area = ew_segment.projection(cow_point)
            field_areas.append(area)
        except GeometryError:
            pass

    total_crossings = sum(field_areas)
    if total_crossings.is_trivial and total_crossings.codomain == -1:
        print("INF")
    else:
        print(int(abs(total_crossings)))

solve()

