    n = int(input())

    if n <= 2:
        print(0)
        return

    MOD = 998244353

    def modinv(x):
        return pow(x, MOD - 2, MOD)

    def C(n, k):
        res = 1
        for i in range(1, k+1):
            res = res * (n - i + 1) % MOD
            res = res * modinv(i) % MOD
