def solve():
    M = 998244353

    n = int(input())
    problems = [tuple(map(int, input().split())) for _ in range(n)]

    mod_inv = lambda x: pow(x, M - 2, M)

    f_memo = {0: 1} # factorial memoization

    def factorial(n):
        if n in f_memo:
            return f_memo[n]
        f_memo[n] = fac = (n * factorial(n - 1)) % M
        return fac

    def binom(n, r):
        return (factorial(n) * mod_inv(factorial(r)) % M) * mod_inv(factorial(n - r)) % M

    ans = 1

    for i, (l_i, r_i) in enumerate(problems):
        for _, (l_j, r_j) in enumerate(problems[:i]):
            ono_inversions = max(0, max(r_i - l_i + 1, r_j - l_j + 1) - max(r_i - r_j, 0) * max(l_j - l_i, 0))
            ans = (ans * mod_inv(ono_inversions) * binom(sum(c in [l_i, r_i, l_j, r_j] for c in (l_i, r_i, l_j, r_j)), 2)) % M

    print(ans)

solve()

