    n, b = map(int, input().split())

    def count_trailing_zeroes(n, base):
        zero_count = 0
        divisor = base
        while n // divisor > 0:
            zero_count += n // divisor
            divisor *= base
        return zero_count

    def factorial(n):
        if n == 0 or n == 1:
            return 1
        return n * factorial(n-1)

