def solve():
    m, a, b = map(int, input().split())

    if a == 1:
        return int((m+1)*(m+2)//2)

    sieve = [True]*(max(a, b)*m+1)
    distinct_reachable_points = [0]*(max(a, b)*m+1)
    sieve[0] = False
    for i in range(1, max(a,b)*(1+m)):
        if i - a >= 0:
            if sieve[i - a]:
                sieve[i] = distinct_reachable_points[i] = True
        if i - b >= 0:
            if sieve[i - b]:
                sieve[i] = distinct_reachable_points[i] = True

    result = 0
    for x in range(m+1):
        for i in range(max(x*a, x*b)+1):
            if distinct_reachable_points[i]:
                result += 1

    return result

