import math

def solve():
    m, a, b = map(int, input().split())
    gcd = math.gcd(a, b)

    def coprime(x):
        if x <= (m % gcd):
            return ((x+1)*x) // 2
        else:
            return coprime(x - a + b)

    res = sum(coprime(i) for i in range(math.ceil(gcd/2)))
    return res

