from math import gcd

def solve(n):
    MOD = 10**9 + 7

    def factorial(n):
        result = 1
        for i in range(1, n + 1):
            result = (result * i) % MOD
        return result

    def count_permutations(n):
        result = 1
        for i in range(2, n + 1):
            result = (result * i) % MOD
        return result

    def f_max(n):
        result = 0
        for i in range(1, n + 1):
            result += gcd(i, n)
        return result

    f_max_val = f_max(n)
    count = 0
    for i in range(1, n + 1):
        if f_max(i) == f_max_val:
            count += 1

    return count_permutations(n) // count % MOD

