from typing import List

def solve(n: int, arr: List[int]) -> int:
    def check(m: int) -> bool:
        unique_values_count = len(set(arr))
        values_set = set()
        for i in range(n):
            values = set()
            for b in range(m):
                if b in values_set:
                    values.add(2 * arr[i] - b)
            values_set |= values
            values_set.add(arr[i])
            if len(values_set) == unique_values_count:
                return True
        return False

    for m in range(1, n):
        if check(m):
            return m
    return -1

solve()

