def solve():
    N = int(input())
    S = input().strip()

    def z_algorithm(s):
        z = [0] * len(s)
        n = len(s)
        l, r = 0, 0
        for i in range(1, n):
            if i <= r:
                z[i] = min(r - i + 1, z[i - l])
            while i + z[i] < n and s[z[i]] == s[i + z[i]]:
                z[i] += 1
            if i + z[i] - 1 > r:
                l, r = i, i + z[i] - 1
        return z

    max_len = 0
    for i in range(N):
        z_prefix = z_algorithm(S[i:])
        for j, k in enumerate(z_prefix, 1):
            max_len = max(max_len, min(k, j))

