    s = input().strip()
    memory = input().strip()

    count = [0] * 10
    for digit in s:
        count[int(digit)] += 1

    for d in memory:
        count[int(d)] -= 1
        if count[0] > 0:
            discard_zero = False
            for i in range(1, 10):
                if count[i]:
                    discard_zero = True
                    break
            if discard_zero:
                count[int(d)] += 1
                count[0] -= 1
                break

    leading_zero = True
    reconstructed_num_list = []

    for digit in memory:
        count_wo_curr_digit = list(count)
        for curr_digit in reconstructed_num_list:
            count_wo_curr_digit[int(curr_digit)] -= 1

        min_digit = next(i for i in range(int(digit)) if count_wo_curr_digit[i] > 0)
        if leading_zero:
            if min_digit > 0:
                leading_zero = False
        else:
            count_wo_curr_digit[0] -= 1
            leading_zero = leading_zero or min_digit == 0

        count_wo_curr_digit[min_digit] -= 1
        if leading_zero or min_digit > 0:
            reconstructed_num_list.append(str(min_digit))

    if count[0] > 0:
        reconstructed_num_list.append('0')

    while sum(count) > 0:
        for digit, digit_count in enumerate(count):
            if digit_count > 0:
                while count[digit] > 0:
                    reconstructed_num_list.append(str(digit))
                    count[digit] -= 1

    print(''.join(reconstructed_num_list))

