def solve():
    import itertools
    s = input()
    remembered_substr = input()

    possibles = []
    for k in range(len(remembered_substr), (len(s) // 2) + 1):
        for permute in itertools.permutations(s, k):
            num = int(''.join(permute))
            pos = str(num) + remembered_substr[:k-len(permute)+1]
            rest = set(s) - set(permute) - {remembered_substr[k-len(permute)]}
            rest_perms = list(itertools.permutations(sorted(rest)))
            if rest_perms:
                min_seq = min(rest_perms)
                possibles.append(pos + ''.join(min_seq))

    print(int(min(possibles)))


