def solve():
    import heapq

    n, m, k = map(int, input().split())
    special_vertices = set(map(int, input().split()))
    graph = {i: [] for i in range(1, n+1)}
    for _ in range(m):
        u, v, w = map(int, input().split())
        graph[u].append((v, w))
        graph[v].append((u, w))

    def dijkstra(start):
        distances = {vertex: float('inf') for vertex in range(1, n+1)}
        distances[start] = 0
        priority_queue = [(0, start)]
        while priority_queue:
            current_distance, current_vertex = heapq.heappop(priority_queue)
            if current_distance > distances[current_vertex]:
                continue
            for neighbor, weight in graph[current_vertex]:
                distance = max(current_distance, weight)
                if distance < distances[neighbor]:
                    distances[neighbor] = distance
                    heapq.heappush(priority_queue, (distance, neighbor))
        return distances

    distances_matrix = {vertex: dijkstra(vertex) for vertex in special_vertices}
    result = [max(distances_matrix[sv].values()) for sv in special_vertices]

    print(' '.join(map(str, result)))

solve()

