def solve():
    import math

    n = int(input())
    cakes = []  # List to store the tuples of (r_i, h_i)

    for _ in range(n):
        r, h = map(int, input().split())
        cakes.append((r, h))

    dp = [-1.0] * n  # Initialized with -1.0

    def calculate_volume(index):
        if dp[index] != -1:
            return dp[index]

        r, h = cakes[index]

        max_height = h
        for i in range(n):
            if cakes[i][0] < r:
                max_height = max(max_height, h + calculate_volume(i))

        dp[index] = math.pi * r * r * max_height
        return dp[index]

    max_volume = 0.0
    for i in range(n):
        max_volume = max(max_volume, calculate_volume(i))

    print('{0:.9f}'.format(max_volume))

