from itertools import groupby

def solve():
    n = int(input())
    s = input()

    def calculate_operations(s):
        op_count = 0
        while s:
            # Group consecutive same letters using groupby
            grouped = [list(g) for k, g in groupby(s)]
            # Get the first group and update s to contain the characters not part of this group
            s = ''.join([subseq for subseq in grouped[0]])
            for subseq in grouped[1:]:
                # No. of delete operations = length of subseq - 1
                op_count += len(subseq) - 1
            # Handle edge case where originally s had only one char
            if len(grouped) == 1:
                break
        return op_count

    return calculate_operations(s)


