from collections import defaultdict

def solve():
    N, M = map(int, input().split())
    adj_list = defaultdict(list)
    for _ in range(M):
        s, t = map(int, input().split())
        adj_list[s].append(t)

    E = [float('inf')] * (N + 1)

    def dfs(node):
        if node == N:
            return 0
        if E[node] != float('inf'):
            return E[node]
        tmp = 0
        cnt = 0
        for neighbor in adj_list[node]:
            tmp += dfs(neighbor)
            cnt += 1
        if cnt != 0:
            E[node] = (tmp + cnt)/cnt
        return E[node]

    expected_passages = dfs(1)
    return '{:.10f}'.format(expected_passages)

solve()

