def solve(s: str, t: str) -> None:
    from collections import Counter

    mismatches = [(s[i], t[i]) for i in range(len(s)) if s[i] != t[i]]
    counterpart_freq = Counter(mismatches)
    swap_pairs = []
    only_keys = set(s + t)

    for key in only_keys:
        key_matching_pos = [m for m in mismatches if key in m]
        if all([key in m and counterpart_freq[m] >= 2 for m in key_matching_pos]):
            key_matching_distinct = {m for m in key_matching_pos}
            for pair in key_matching_distinct:
                swap_pairs.append(pair)

    if len(set(mismatches)) != len(swap_pairs) * 2:
        print(-1)
