def solve(s, t):
    mappings = {}

    for i in range(len(s)):
        key_s = s[i]
        key_t = t[i]

        if key_s in mappings:
            if mappings[key_s] != key_t:
                return -1

        elif key_s != key_t:
            if key_t in mappings:
                return -1

            mappings[key_s] = key_t
            mappings[key_t] = key_s

    swaps = {}
    ans = []
    visited = set()

    for key in mappings:
        if key in visited:
            continue

        visited.add(key)
        visited.add(mappings[key])

        swaps[key] = mappings[key]
        swaps[mappings[key]] = key
        ans.append(f'{key} {mappings[key]}')

    if len(swaps) % 2 == 1:
        return -1

    return "\n".join(str(len(ans)) + "\n" + "\n".join(a for a in ans)

