from fractions import Fraction

def solve(n):
    if n == 1:
        return ('NO',)

    sequence = []
    for bk in range(2, n):
        ak = bk * (n - 1) - 1
        if ak % bk == 0 and 1 <= ak // bk < bk:
            sequence.append((ak // bk, bk))

    if sum(Fraction(ai, bi) for ai, bi in sequence) == 1 - Fraction(1, n):
        return ('YES', len(sequence), *(' '.join(map(str, pair)) for pair in sequence))
    else:
        return ('NO',)


solve()

