def solve():
    from itertools import combinations
    from collections import Counter

    def is_subseq(subseq, string):
        string_iter = iter(string)
        return all(char in string_iter for char in subseq)

    def longest_subseq_not_common(string1, string2):
        if string1 == string2:
            return -1
        substrings1 = set(string1)
        substrings2 = set(string2)
        uncommon_subseqs = substrings1.difference(substrings2).union(substrings2.difference(substrings1))
        longest_len = -1
        for subseq in uncommon_subseqs:
            if is_subseq(subseq, string1) or is_subseq(subseq, string2):
                cur_len = len(subseq)
                longest_len = max(longest_len, cur_len)
        return longest_len

