def solve():
    from collections import deque

    n, m = map(int, input().split())
    prices = list(map(int, input().split()))
    auction_questions = set(map(int, input().split()))

    question_points = 0
    players_points = 0
    auction_questions_prices = {}

    for i in range(n):
        if i + 1 in auction_questions:
            auction_questions_prices[i + 1] = prices[i]

    player_order = deque(["R2"])
    for q in auction_questions:
        player = player_order[0]

        if players_points >= auction_questions_prices[q]:
          adjusted_price = min(players_points, auction_questions_prices[q])
          players_points -= adjusted_price
          question_points += adjusted_price

        players_points += prices[q - 1]
        question_points += prices[q - 1]

        if player != "R2":
            player_order.appendleft(player)

        limits = max(players_points * (m - len(player_order)), m - 1)
        if len(player_order) <= limits:
          found_player = False
          while not found_player:
              current_player = player_order.pop()

              if current_player not in player_order:
                  found_player = True

          player_index = player_order.index(current_player)
          player_order.rotate(player_index)

    print(question_points)

