def solve():
    import math

    a, b, k = input().split()
    a, b, k = int(a), int(b), int(k)

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                return False
        return True

    def num_primes_between(a, b):
        count = 0
        for num in range(a, b+1):
            if is_prime(num):
                count += 1
        return count

    max_range = b - a + 1
    for l in range(1, max_range + 1):
        valid_l = True
        for x in range(a, b - l + 2):
            if num_primes_between(x, x + l) < k:
                valid_l = False
                break
        if valid_l:
            return l
    return -1

solve()

