    for letter, count in counts.items():
        if count % 2 != 0:
            odd_count += 1

    if odd_count > 1:
        print("No palindrome can be formed by reordering and changing letters.")
        return

    palindrome = []
    odd_character = ""
    for letter, count in sorted(counts.items()):
        palindrome.extend([letter]*(count//2))
        if count % 2 != 0:
            odd_character = letter

    right_half = palindrome[::-1]
    if odd_count == 1:
        palindrome.append(odd_character)

    palindrome.extend(right_half)

    return ''.join(palindrome)

solve()

