from collections import Counter

def solve(s):
    counter = Counter(s)
    middle_char = ''
    odd_count_chars = ''
    result = []

    for char, count in counter.items():
        if count % 2 == 1:
            if middle_char:
                return 'NO SOLUTION'
            else:
                middle_char = char
            count -= 1

        result.extend([char] * (count // 2))

    if len(result) < len(s) // 2:
        return 'NO SOLUTION'

    odd_count_chars = middle_char * int(len(result) < len(s) // 2)
    result.sort()

    return ''.join(result) + odd_count_chars + ''.join(result[::-1])

#EXAMPLES TO TEST:
