import collections

def solve(s: str) -> str:
    cnt = collections.Counter(s)
    odd_char = None
    new_s = ""
    for c in sorted(cnt):
        if cnt[c] % 2 == 1:
            if odd_char is not None:
                return "IMPOSSIBLE"
            odd_char = c
        new_s += c * (cnt[c] // 2)
    if odd_char is not None:
        new_s += odd_char
    palindrome = new_s + new_s[::-1]
    return palindrome

