from math import sqrt

def solve():
    x1, y1, r1 = map(int, input().split())
    x2, y2, r2 = map(int, input().split())

    d = sqrt((x2-x1)**2 + (y2-y1)**2)

    if d >= r1 + r2:
        return 0.0
    if d <= abs(r1 - r2) and r1 >= r2:
        return 3.14159265358979323846 * (r2 * r2)
    if d <= abs(r1 - r2) and r1 < r2:
        return 3.14159265358979323846 * (r1 * r1)

    alpha_1 = 2 * acos((r1*r1 + d*d - r2*r2) / (2 * r1 * d))
    alpha_2 = 2 * acos((r2*r2 + d*d - r1*r1) / (2 * r2 * d))

    area_triangle_1 = 0.5 * r1 * r1 * sin(alpha_1)
    area_sector_1 = 0.5 * r1 * r1 * alpha_1

    area_triangle_2 = 0.5 * r2 * r2 * sin(alpha_2)
    area_sector_2 = 0.5 * r2 * r2 * alpha_2

    area_intersection = area_sector_1 + area_sector_2 - area_triangle_1 - area_triangle_2

    return area_intersection


solve()

