def solve():
    import heapq

    n = int(input())
    strengths = list(map(int, input().split()))
    graph = {i: [] for i in range(1, n+1)}

    for _ in range(n-1):
        u, v = map(int, input().split())
        graph[u].append(v)
        graph[v].append(u)

    stack = []
    for i in range(1, n+1):
        if len(graph[i]) == 1:
            stack.append(i)

    hq = [(-strengths[i-1], i) for i in stack]
    heapq.heapify(hq)

    ans = 0   
    while hq:
        strength, u = heapq.heappop(hq)
        if strengths[u-1] >= 0:
            break
        for v in graph[u]:
            if strengths[v-1] < 0:
                continue
            ans -= strengths[v-1]
            strengths[v-1] = -1
            strengths[u-1] += 1
            ans += strengths[u-1]

            if strengths[u-1] < 0:
                heapq.heappush(hq, (-strengths[u-1], u))

    return -strength + ans

solve()

