import networkx as nx

def build_k_regular_graph_with_bridge(k):
    if k % 2 == 1 or k == 0:
        return "NO"

    G = nx.Graph()
    num_vertices = k + 1

    for i in range(1, num_vertices):
        G.add_edge(i, (i % (k) + 1))

    G = nx.complement(G)
    remaining_edges = ((num_vertices * k) // 2) - (k + 1)
    for i in range(2, num_vertices):
    	for j in range(i + 1, num_vertices + 1):
            if remaining_edges <= 0:
	            break
            if G.has_node(i) and G.has_node(j):
            	G.add_edge(i, j)
            	remaining_edges -= 1

    output_str = "YES\n" + str(num_vertices) + " " + str(G.number_of_edges())
    for e in G.edges:
        output_str += f"\n{e[0]} {e[1]}"

    return output_str

