def solve():
    a, b = map(int, input().split())
    def gcd(a, b):
        while b != 0:
            a %= b
            a, b = b, a
        return a
    period_set = set()
    for i in range(1, min(a, b)+1):
        if a == b:
            period_set.add(a)
        else:
            if a % i == b % i == 0:
                if i == gcd(a, b):
                    period_set.add(i)
                if a/i == gcd(a, b/i):
                    period_set.add(a // i)
                if a == gcd(a, b - i):
                    period_set.add(a)
                if b == gcd(a - i, b):
                    period_set.add(b)
    print(len(period_set))

