def solve():
    a, b = map(int, input().split())
    n = min(a, b)  # maximum possible period length

    ans = 1  # default period length == |s|
    for d in range(1, n+1):
        if a % d == 0 and b % d == 0:
            found = True
            for i in range(d, n):
                if a % i != d * (a // d):  # doesn't have cycles with period 'd'
