import math

def solve():
    l, r = map(int, input().split())

    # An integer is a 2-3 integer if it can be represented as 2^x * 3^y, where x and y are non-negative integers.
    def is_2_3_integer(num):
        while num % 2 == 0:
            num //= 2
        while num % 3 == 0:
            num //= 3
        return num == 1

    # Count the number of 2-3 integers within the given range [l, r].
    count = 0
    for x in range(l, r + 1):
        if is_2_3_integer(x):
            count += 1

    print(count)

solve()

