def solve():
    def restore_numbers(nums):
        num_mapping = {}
        current_num = 1
        for num_str in sorted(nums.keys(), key=lambda x: len(x)):
            for char in num_str:
                if char not in num_mapping:
                    num_mapping[char] = str(current_num)
                    for other_num, text in num_mapping.items():
                        if num_mapping[char] == text:
                            current_num += 1
                            if current_num == 10:
                                current_num += 1  # skip 0
                                if current_num == 11:
                                    current_num += 1
                    if current_num == 10:
                        current_num += 1  # skip 0
            current_num += 1
        for num in nums:
            converted_num = "".join(num_mapping[char] for char in num)
            yield int(converted_num)


    count = int(input())
    s_list = [input() for _ in range(count)]
    nums_code = defaultdict(int, Counter(s_list))

    result = sum(restore_numbers(nums_code))

    return result

