from itertools import permutations

def solve():
    def is_intersects(seg1, seg2):
        def orientation(p,q,r):
            val = (q[1] - p[1]) * (r[0] - q[0]) - (q[0] - p[0]) * (r[1] - q[1]);
            if val == 0: return 0 
            return 1 if val > 0 else -1
        p1, q1 = seg1
        p2, q2 = seg2

        o1 = orientation(p1, q1, p2)
        o2 = orientation(p1, q1, q2)
        o3 = orientation(p2, q2, p1)
        o4 = orientation(p2, q2, q1)

        if o1 != o2 and o3 != o4: return True
        if o1 == 0 and min(p1,p2) <= q1 <= max(p1,p2): return True
        if o2 == 0 and min(p1,q2) <= q1 <= max(p1,q2): return True
        return False

    def is_valid_assignment(ship_positions, base_positions):
        for assignment in permutations(range(len(ship_positions))):
            collision = False
            for i in range(len(assignment) - 1):
                if is_intersects((ship_positions[assignment[i]], base_positions[i]), (ship_positions[assignment[i+1]], base_positions[i+1])):
                    collision = True
                    break
            if not collision and not is_intersects((ship_positions[assignment[-1]], base_positions[-1]), (ship_positions[assignment[0]], base_positions[0])):
                return True
        return False

    R, B = map(int, input().split())
    ships = [tuple(map(int, input().split())) for _ in range(R)]
    bases = [tuple(map(int, input().split())) for _ in range(B)]

    if is_valid_assignment(ships, bases):
        print("Yes")
    else:
        print("No")

