def solve():
    N, X, D = map(int, input().split())
    MOD = 10**9 + 7

    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def lcm(a, b):
        return a * b // gcd(a, b)

    if D == 0:
        if X == 0:
            return 1
        else:
            return N + 1

    X = (X % D + D) % D
    X_inv = pow(X, MOD - 2, MOD)
    D_inv = pow(D, MOD - 2, MOD)

    ans = 0
    for k in range(N + 1):
        if k * (k - 1) // 2 > N:
            break
        L = lcm(N, D)
        a = (N - k) * X % L
        b = (N - k) * (N - k - 1) // 2 % L * D % L
        c = k * (k - 1) // 2 % L * D % L
        d = k * X % L
        e = (a + b + c + d) % L
        cnt = (N - k) // L + 1
        if e == 0:
            ans += cnt
        elif X == 0:
            ans += cnt * (N - k + 1)
        else:
            f = (e * X_inv % L + L) % L
            g = (e * D_inv % L + L) % L
            if f * (f - 1) // 2 % L == g:
                ans += cnt

    return ans

solve()

