def solve(input_str: str) -> str:
    alphabet = "ABCDEFGHIJKLMNOPQRSTUVWXYZ"
    question_mark_count = input_str.count('?')

    if len(input_str) < 26 or question_mark_count > 26:
        return "-1"

    without_questions = [char for char in input_str if char != '?']
    unique_chars = set(without_questions)

    if len(unique_chars) + question_mark_count < 26:
        return "-1"

    res = list(input_str)
    for i in range(len(input_str)):
        if res[i] == '?':
            for char in alphabet:
                if char not in unique_chars:
                    unique_chars.add(char)
                    res[i] = char
                    break
        if len(unique_chars) == 26:
            break

    return ''.join(res)

