def count_min_arithmetic_progressions(sequence_length: int, sequence: List[int]) -> int:
    cnt = 0
    idx = 0

    if len(sequence) == 1: return 1

    while idx < sequence_length:

        if sequence[idx] == -1 or idx == sequence_length - 1:
            cnt += 1

            while idx < sequence_length and sequence[idx] == -1:
                idx += 1

            if idx < sequence_length and sequence[idx] != -1:
                dst = idx - 1
                diff = sequence[dst + 1] - sequence[dst]

                while idx < sequence_length:

                    if sequence[idx] != -1 and sequence[idx] - sequence[dst] == diff:
                        dst = idx
                        idx += 1

                    else:
                        break

        else:
            idx += 1

    return cnt


