import sympy

def solve(x: int, n: int) -> int:
    MOD = 10**9 + 7

    def prime(x):
        p = sympy.primefactors(x)
        return p

    def g(x, p):
        max_power = 0
        i = sympy.trunc(x ** 0.5)
        while i > 1:
            if x % i == 0:
                exp_cnt = 0
                while x % i == 0:
                    x //= i
                    exp_cnt += 1
                if i == p:
                    max_power = max(max_power, exp_cnt)
            i -= 1
        if x == p:
            max_power = max(max_power, 1)
        return p ** max_power

    res = 1
    for y in range(1, n+1):
        p_set = prime(x)
        product = 1
        for p in p_set:
            product *= g(y, p)
            product %= MOD
        res *= product
        res %= MOD

    return res

solve()

