        primes = set()
        for i in range(2, int(math.sqrt(x)) + 1):
            while x % i == 0:
                primes.add(i)
                x //= i

        if x > 1:
            primes.add(x)
        return primes

    def prime_divisor_power(x, p):
        power = 0
        while x % p == 0:
            x //= p
            power += 1
        return p ** power

    def get_f(x, n):
        primes_x, res = prime_factors(x), 1
        for i in range(1, n + 1):
            temp = [(prime_divisor_power(i, p) if i % p == 0 else 1) for p in primes_x]
            for t in temp:
                res *= t
                res %= 10 ** 9 + 7
        return res

    x, n = map(int, input().split())
    answer = get_f(x, n)
    print(answer)

