        factors = []
        for i in range(2, int(math.sqrt(n)) + 1):
            while n % i == 0:
                factors.append(i)
                n //= i
        if n > 1:
            factors.append(n)
        return factors

    def prime_divisors(target):
        primes_set = set(primes(target))
        return primes_set

    def g(target, p):
