        while target % (p**(k+1)) == 0:
            k += 1
        return p**k

    def f(target, y_value):
        p_factors = prime_divisors(target)
        result = 1
        for p in p_factors:
            result *= g(y_value, p)
        return result % (10**9 + 7)

    x, n = map(int,input().split())
    answer = 1
    for i in range(1, n+1):
        answer *= f(x, i)
        answer %= 10**9 + 7
    print(answer)

