def solve():
    import math

    def factorize(num):
        factors = {}
        for i in range(2, int(math.sqrt(num)) + 1):
            while num % i == 0:
                num //= i
                factors[i] = factors.get(i, 0) + 1
        if num > 1:
            factors[num] = factors.get(num, 0) + 1
        return factors

    def g(x, p):
        exp = 0
        while x % (p ** (exp + 1)) == 0:
            exp += 1
        return p ** exp

    def f(x, y):
        factors_x = factorize(x)
        result = 1
        for prime_num in factors_x:
            result *= g(y, prime_num)
            result %= (10**9 + 7)
        return result

    ans = 1
    x, n = map(int, input().split())
    for i in range(1, n + 1):
        ans *= f(x, i)
        ans %= (10**9 + 7)
    print(ans)

solve()

