def solve():
    import numpy as np

    def are_adjacent(a, b):
        x_A, y_A = divmod(a, 13)
        x_B, y_B = divmod(b, 13)

        x_diff = abs(x_A - x_B)
        y_diff = abs(y_A - y_B)

        if (x_diff, y_diff) in [(0, 1), (1, 1), (1, 0)]:
            return True
        return False

    def find_path(indices):
        path = [chr(indices[0] + ord('A'))]

        for i in range(1, len(indices)):
            if not are_adjacent(indices[i - 1], indices[i]):
                return None

            path.append(chr(indices[i] + ord('A'))

        return path

