def solve():
    s, x1, x2 = map(int, input().split())
    t1, t2 = map(int, input().split())
    p, d = map(int, input().split())

    # Distance calculation if the tram need to complete a round trip
    dist = abs(x1 - p)

    # Time to get to x2 independently from the tram if it is inefficient to wait
    time_min = min(abs(x2 - x1) * t2, (dist % (s+t1)) * t2 if dist <= s-t1 else 10**12)

    if d == 1:  # Tram direction: point 0 to point s
        if (x1 <= p and x2 <= p) or (x1 >= p and x2 >= p):
            time_actual = abs(x2 - x1) * t2

        else:
            time_actual = abs(p - x1) * t2
            boost_cont = (time_actual + t1 * abs(p - x2)) % (t1 + t2)

            while p + boost_cont * (1 if x2 > p else -1) != x2:
                boost_cont = boost_cont + 1 if x2 > p else boost_cont - 1

            time_actual += boost_cont

        return min(time_actual, time_min)

    else:   # Tram direction: point s to point 0
        if (x1 >= p and x2 <= p) or (x1 <= p and x2 >= p):
            time_actual = abs(x2 - x1) * t2

        else:
            time_actual = abs(p - x1) * t2
            boost_cont = (time_actual + t1 * abs(p - x2)) % (t1 + t2)

            while p - boost_cont * (1 if x2 > p else -1) != x2:
                boost_cont = boost_cont + 1 if x1 < p else boost_cont - 1

            time_actual += boost_cont

        return min(time_actual, time_min)


solve()

