from collections import defaultdict

def solve():
    n = int(input())
    move = input()
    x = list(map(int, input().split()))

    collisions = defaultdict(int)
    min_collision = float('inf')

    for i in range(n):
        if move[i] == 'R':
            min_collision = min(min_collision, (x[i + 1] - x[i]) // 2) if i < n - 1 else min_collision   # Rightward movement
        else:
            collisions[x[i] - x[i + 1]] += 1   # Leftward movement

    if min_collision <= 0:
        return -1

    for interval,dist_count in collisions.items():
        if dist_count > 1:
            min_collision = min(min_collision, interval) 

    return min_collision


