def solve():
    import sys

    read = sys.stdin.readline
    n = int(read())

    edges = {}
    for _ in range(1, n):
        u, v = map(int, read().split())
        if u not in edges:
            edges[u] = []
        if v not in edges:
            edges[v] = []

        edges[u].append(v)
        edges[v].append(u)

    visited = set()
    coordinates = {}

    def dfs(node, x, y, px, py):
        visited.add(node)
        coordinates[node] = (x, y)

        for neighbor in edges[node]:
            if neighbor not in visited:
                for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                    if (dx, dy) != (px, py):
                        offx = dx + x
                        offy = dy + y
                        break

                dfs(neighbor, offx, offy, -dx, -dy)

    dfs(1, 0, 0, 0, 0)

    if len(coordinates) == n:
        print("YES")
        for i in range(1, n + 1):
            print(*coordinates[i])
    else:
        print("NO")


solve()
